import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var AlertCircle = createReactComponent("AlertCircle", ["svg", defaultAttributes, [["circle", {
  cx: "12",
  cy: "12",
  r: "10",
  key: "14id60"
}], ["line", {
  x1: "12",
  y1: "8",
  x2: "12",
  y2: "12",
  key: "1y3920"
}], ["line", {
  x1: "12",
  y1: "16",
  x2: "12.01",
  y2: "16",
  key: "14g55c"
}]]]);
export default AlertCircle;
